dataset:
  derived_channels:
    CDA101:
      colour: ''
      dependencies:
      - DT730
      - M730
      - PTX101
      - PTX102
      expr: (10**6) * M730 / sqrt(2 * DT730 * (PTX102 - PTX101) * (10**5))
      groups:
      - derived
      id: CDA101
      name: CDA101 Fuel Injector CdA
      units: mm^2
    CDA102:
      colour: ''
      dependencies:
      - DT730
      - M730
      - PT732
      - PTX102
      expr: (10**6) * M730 / sqrt(2 * DT730 * (PT732  - PTX102) * (10**5))
      groups:
      - derived
      id: CDA102
      name: CDA102 Regen Channel CdA
      units: mm^2
    CDA201:
      colour: ''
      dependencies:
      - DT850
      - M850
      - PT852
      - PTX101
      expr: (10**6) * M850 / sqrt(2 * DT850 * (PT852 - PTX101) * (10**5))
      groups:
      - derived
      id: CDA201
      name: CDA201 Ox Injector CdA
      units: mm^2
    CSTAR:
      colour: ''
      dependencies:
      - M730
      - M850
      - PTX101
      expr: (PTX101 +1) * 0.0014 * (10**5) / (M730 + M850)
      groups:
      - derived
      id: CSTAR
      name: CSTAR
      units: m/s
    DPX101:
      colour: ''
      dependencies:
      - PTX101
      - PTX102
      expr: PTX102 - PTX101
      groups:
      - derived
      id: DPX101
      name: DPX101 Fuel Injector dP
      units: Pressure (bar(g))
