      colour: ''
      dependencies:
      - PT852
      - PTX101
      expr: PT852 - PTX101
      groups:
      - derived
      id: DPX102
      name: DPX102 Ox Injector dP
      units: bar(g)
    DPX103:
      colour: ''
      dependencies:
      - PT732
      - PTX102
      expr: PT732 - PTX102
      groups:
      - derived
      id: DPX103
      name: DPX103 Regen Channel dP
      units: bar(g)
    DTCX101:
      colour: ''
      dependencies:
      - TC732
      - TCX101
      expr: 'TCX101 -TC732 '
      groups:
      - derived
      id: DTCX101
      name: DTCX Fuel Temp Rise
      units: ''
    DTX101:
      colour: ''
      dependencies:
      - TC732
      - TCX101
      expr: 'TCX101 -TC732 '
      groups:
      - derived
      id: DTX101
      name: DTX Fuel Temp Rise
      units: degC
    ISP:
      colour: ''
      dependencies:
      - LC600
      - M730
      - M850
      expr: LC600 / (9.81 * (M730 + M850))
      groups:
      - derived
      id: ISP
      name: ISP
      units: ''
    ISPX:
      colour: ''
      dependencies:
      - LC600
      - M730
      - M850
      expr: LC600 / (9.81 * (M730 + M850))
      groups:
      - derived
      id: ISPX
      name: ISP Experiment
      units: s
    OF:
      colour: ''
      dependencies:
      - M730
      - M850
      expr: M850 / M730
      groups:
      - derived
      id: OF
      name: OF Ratio
      units: ''
    OFR:
      colour: ''
      dependencies:
      - M730
      - M850
      expr: M850 / M730
      groups:
      - derived
      id: OFR
      name: OF Ratio
      units: OF
